export function forEach<F extends HKT, G extends HKT>(F: ForEach<F>, G: ForEach<G>) {
  return <T extends HKT>(IBC: IdentityBoth<T> & Covariant<T>) => {
    const forEachF = F.forEach(IBC)
    const forEachG = G.forEach(IBC)

    return <A, B>(f: (a: A) => Kind<T, B>) => forEachF(forEachG(f))
  }
}
